﻿<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">

<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <title>Site Unavailable</title>
    
    <style type="text/css">
    body {margin:0; color:#ffffff; font-family:Arial, Sans-Serif; font-size:0.8em;  background-color:#000000;}
    a {color:#ffffff; text-decoration:none; }
    img.logo { margin-bottom: 20px; }
    a.website { font-weight: bold; background-image:url('images/arrow.gif'); background-position:left top; background-repeat:no-repeat; padding:0 0 0 20px; }
    a:hover { text-decoration: underline; }
    div#container {width:100%; min-height:450px; background-image:url('images/footer-fill.gif'); background-position:bottom; background-repeat:repeat-x;}
    div#content {margin: 0 auto; padding-top:150px; width:290px; }
    </style>
    
    <script language="javascript">
    
    function moveBar()
    {
        var h;
    
        if( typeof( window.innerWidth ) == 'number' ) { 
            h = window.innerHeight; 
        } else if( document.documentElement && document.documentElement.clientHeight) { 
            h = document.documentElement.clientHeight; 
        } else if( document.body && document.body.clientHeight) { 
            h = document.body.clientHeight; 
        }
        document.getElementById("container").style.height = h + "px";
        document.getElementById("content").style.paddingTop = (h-280)/2 + "px";
        
    }
    
    window.onload = moveBar;
    window.onresize = moveBar;
    
    </script>
    
</head>
<body>

    <div id="container">
        <div id="content">
            <br /><img src="images/site-unavailable.gif" alt="Site unavailable" />
            <p>This site is not live. Please contact us<br/>via our main website.</p>
        </div>
    </div>

</body>
</html>

